import React from "react";
import "./CreateAdvogado.css";
import Card from "../../components/Card";
import FormGroup from "../../components/FormGroup";
import axios from "axios";
import Button from '@mui/material/Button';
import ButtonGroup from '@mui/material/ButtonGroup';

export default class CreateAdvogado extends React.Component{

    state = {
        login: ' ',
        senha:' ',
        nome:' ',
        cpf:' ',
        inscricao:' ',
        estadoDeEmissao:' ',
        filiacao:' ',
        dataDeNascimento:' '
    }

    cadastrar = async() => {

        await axios.post('http://localhost:8080/api/advogado',
        {
         login: this.state.nome,
         senha: this.state.cartel
        }
        ).then(response => 
         {
           console.log(response);
         }
         ).catch(error => 
           {
             console.log(error.response);
           });
           console.log('request finished');
       }

       cancel = () =>{
        console.log('cancel');
      }

      render(){
        return(

        <div className="container">
                <div className="row">
                    <div className="col-lg-12">
                        <div className="bs-component">
                        <div style={{marginTop: '70px'}}>
                        <ButtonGroup variant="contained" aria-label="Basic button group" >
                            <Button>One</Button>
                            <Button>Two</Button>
                            <Button>Three</Button>
                            </ButtonGroup>
                            <div style={{width: 1306, height: 718, left: 98, top: 174, position: 'absolute', background: 'white', border: '1px #838383 solid'}}></div>
    <div style={{width: 292, height: 36, padding: 10, left: 800, top: 642, position: 'absolute', background: '#ECECEC', borderRadius: 5, borderBottom: '2px #838383 solid'}} />
    <div style={{width: 292, height: 36, padding: 10, left: 800, top: 497, position: 'absolute', background: '#ECECEC', borderRadius: 5, borderBottom: '2px #838383 solid'}} />
    <div style={{width: 292, height: 36, padding: 10, left: 800, top: 348, position: 'absolute', background: '#ECECEC', borderRadius: 5, borderBottom: '2px #838383 solid'}} />
    <div style={{width: 292, height: 36, padding: 10, left: 154, top: 773, position: 'absolute', background: '#ECECEC', borderRadius: 5, borderBottom: '2px #838383 solid'}} />
    <div style={{width: 292, height: 36, padding: 10, left: 154, top: 624, position: 'absolute', background: '#ECECEC', borderRadius: 5, borderBottom: '2px #838383 solid'}} />

    <div style={{width: 461, height: 344, left: 154, top: 447, position: 'absolute'}}>

    </div>



                            <button onClick={this.cadastrar} type="button" className="btn btn-success">
                                <i className="pi pi-save"></i> Cadastrar
                            </button>
                            <button onClick={this.cancel} type="button" className="btn btn-danger">
                                <i className="pi pi-cancel"></i> Cancelar
                            </button>
                            </div>
                        </div>
                    </div>
                </div>


        </div>
        )
      }

}

